const SET_EMPLOYEES = "SET_EMPLOYEES"

let initialState = {
    employees: [],
}

const employeesReducer = (state = initialState, action) => {
    switch (action.type) {
        case SET_EMPLOYEES:
            return {
                ...state,
                users: action.users
            }
            break;
        default:
            return state;
    }
    return state;
}

export default employeesReducer;
